import React from 'react';
import { Image, Grid, Feed, Icon, Card, Header } from 'semantic-ui-react';

const _HeaderMovieCast = props => {

    return (
        <React.Fragment>
            <Grid className="customImageDisplayForTop5">
                <Grid.Column>
                    <Image onClick={() => props.movieDetials()} src={props.movieImage} className="sizeOfNewSearchMovieForTop5" />
                    {props.MovieIdSelected == props.movie.id ? "helllo" : ""}
                </Grid.Column>
            </Grid>
        </React.Fragment >
    )
}

export default _HeaderMovieCast;
